/* Packages variables
** These variables are used to override packages
** ---------------------------------------------- */
/* Debug
** Output variables to the top of the UI
** ------------------------------------- */
.emmet-panel {
  position: absolute;
  z-index: 10;
  background: #383838;
  color: #a8a8a8;
  padding: 5px;
  min-width: 200px;
  font-size: 12px;
  -webkit-box-shadow: 0 0 20px rgba(0, 0, 0, 0.5);
  box-shadow: 0 0 20px rgba(0, 0, 0, 0.5);
}
.emmet-panel-tail {
  position: absolute;
  left: 8px;
  margin-top: -6px;
  width: 15px;
  height: 15px;
  content: '';
  display: inline-block;
  background: inherit;
  z-index: -1;
  -webkit-transform: rotate(45deg);
  transform: rotate(45deg);
}
.emmet-panel atom-text-editor[mini] {
  z-index: 1;
  line-height: 16px;
}
.emmet-prompt {
  min-width: -webkit-min-content;
  padding: 10px;
